import React from 'react';
import "./App" ;
import {Link} from 'react-router-dom';

class Nav extends React.Component{
    render(){ 
        return (
        <nav>
            <h3>Logo</h3>
            <ul className='nav-links'>
                <Link to='/Register'>
                    <li>Register</li>
                </Link>
            </ul>
        </nav>)
};
}

export default Nav;
